空気圧不足のタイヤは大変危険！<br>定期的な測定を！扁平タイヤの必需品です。<br><br>ストッパーにより指針が止まり数値が簡単にわかります。<br>適正空気圧でパンク、バースト防止に。<br>タイヤの摩耗、制動距離の確保に。<br><br>●KPA気圧70～525kpaまで計測可能です。<br><br><br>■仕様<br>本体サイズ：50(W) x 112(H) x 25(D)mm/35g<br>適合車種：オートバイ・軽自動車・乗用車・四輪駆動車<br><br>メーカー名：大自工業株式会社/メルテック<br>品番：F-101<style type="text/css">
